    // FIX: check if this address is already in the map
    std::map<swig_cast_info *, int>::iterator it = castMap.find(cast);
    if (it != castMap.end())
    {
      break;
    }
    else
    {
      castMap.insert(it, std::map<swig_cast_info *, int>::value_type(cast, -1));
    }

